import MainCom from "./MainCom";

const Management = () =>{
    return(
        <section className="management">
        <MainCom 
            heading="Management"
        />
        <div className="container mng">
            <div className="row">
                <div className="col-12">
                    <h3>404 | Not Found</h3>
                </div>
            </div>
        </div>

        </section>
    )
}
export default Management;
